import { optimizeLabelStack } from '../common/utils';
export function optimizeApdex(apdex, reactUFOVersion) {
  return apdex.map(({
    stopTime,
    labelStack,
    ...others
  }) => ({
    ...others,
    stopTime: Math.round(stopTime),
    ...(labelStack ? {
      labelStack: optimizeLabelStack(labelStack, reactUFOVersion)
    } : {})
  }));
}